import React from 'react';
import icon from './assets/frame6a21.png';

const Frame6a21 = () => {
  return (
    <div
      style={{
        width: '253px',
        height: '240px',
        display: 'flex',
        flexDirection: 'column',
        gap: '8px',
        paddingLeft: '20px',
        paddingRight: '20px',
        boxSizing: 'border-box',
        borderLeft: '0.5px dashed rgba(238,66,55,1)',
      }}
    >
      {/* Frame6a21 content goes here */}
      <div
        style={{
          width: '89.69px',
          height: '89.69px',
          borderRadius: '116px',
          background: 'rgba(255,255,255,1)',
          border: '1px solid rgba(238,66,55,1)',
          boxShadow: '0 4px 4px -4px rgba(12,12,13,0.05), 0 16px 32px -4px rgba(12,12,13,0.1)',
          display: 'flex',
          alignItems: 'center',
          justifyContent: 'center',
          margin: '0 auto',
        }}
      >
        <img src={icon} alt="icon" style={{ width: '60px', height: '60px', background: 'white', borderRadius: '50%' }} />
      </div>
      <div style={{ height: '20px' }} />
      <div
        style={{
          width: '213px',
          height: '28px',
          color: 'rgba(28,38,76,1)',
          fontFamily: 'Sora, sans-serif',
          fontWeight: 600,
          fontSize: '22px',
          lineHeight: '28px',
          letterSpacing: '-0.05em',
        }}
      >
        Track Your Load
      </div>
      <div
        style={{
          width: '213px',
          height: '104px',
          color: 'rgba(0,0,0,1)',
          fontFamily: 'Sora, sans-serif',
          fontWeight: 400,
          fontSize: '16px',
          lineHeight: '26px',
          letterSpacing: '-0.05em',
        }}
      >
        Know exactly where your goods are, anytime. Live GPS tracking keeps you informed from pickup to delivery.
      </div>
    </div>
  );
};

export default Frame6a21;
